import { BrowserRouter, Route, Routes } from "react-router-dom";
import { Nav , Home , Footer , Men , Women} from "./components/index";
function App() {
  return (
    <>
    <BrowserRouter>
      <Nav/>
      <Routes>
       <Route path="/" element={<Home/>} />
       <Route path="/Men" element={<Men/>} />
       <Route path="/Women" element={<Women/>} />
      </Routes>
       <Footer/>
    </BrowserRouter>
    </>
  );
}

export default App;
